import styled from 'styled-components';
import artist from '../images/artist.jpg';

const DIV = styled.div`
    /* ARTIST PICTURE */
        text-align: center;
        margin-top: 80px;
    #artist{
        margin: 0 auto;
        max-width: 85%;
        transition: all linear 0.2s;
    }
    #artist:hover{
        width: 560px;
    }
    /* ARTIST PICTURE */

`

const Pics = () => {
    return (  
        <DIV className='artist-div'>
            <img id="artist" src={artist} alt="artist" width="550px" />
        </DIV>
    );
}
 
export default Pics;
